import landingPage from "./components/LandingPage/landingPage" 


function App() {
  return (
    <div className="App">
      <h1>Messi</h1>
    </div>
  );
}
<BrowserRouter> 
<Switch> 

<Route exact path='/' component={landingPage} /> 
</Switch>
</BrowserRouter>






export default App;
